DROP PROCEDURE IF EXISTS `BookGenre`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `BookGenre` (IN `id` INT)  begin
declare res varchar(100) default NULL;

(select tmp.genre into res from 
(select count(*)as number,b.genre as genre 
from users u, users_books ub, books b where u.id_user=ub.id_user and b.id_book=ub.id_book and u.id_user=id group by b.genre) as tmp having max(tmp.number));
update users_activity set books=res where users_activity.id_user=id;
end$$

DROP PROCEDURE IF EXISTS `MovieGenre`$$
