(select tmp.genre into res from 
(select count(*)as number,m.genre as genre 
from users u, users_movies um, movies m where u.id_user=um.id_user and m.id_movie=um.id_movie and u.id_user=id group by m.genre) as tmp having max(tmp.number));
update users_activity set movies=res where users_activity.id_user=id;
end$$

